import chiLogo from './chiLogo.png';
import detLogo from './detLogo.png';
import gnbLogo from './gnbLogo.png';
import minLogo from './minLogo.png';

function chiButton() {
  window.location.replace("/chi");
}
function gnbButton() {
  window.location.replace("/gnb");
}
function detButton() {
  window.location.replace("/det");
}
function minButton() {
  window.location.replace("/min");
}

function NFCNorth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>NORTH</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={chiButton}>
            <img class="logos" src={chiLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={gnbButton}>
            <img class="logos" src={gnbLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={detButton}>
            <img class="logos" src={detLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={minButton}>
            <img class="logos" src={minLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}

export default NFCNorth;
